window.bookSummaryJSON = "<p><b>Death! Downfall! Despair! Darkness!</b></p> <p>So much darkness. At least it made hiding easier. Daniel and his group of close friends barely made it away from the mob and their underhanded allies among the Cabal. Now, they were hunted prey, forced to ditch their beloved floating castle in order to find a place to hide.</p> <p>But where could you possibly hide when the Dawnlight Forest would soon be teeming with people looking for you? That’s right. Underground. Quite literally.</p> <p>The beleaguered group of adventurers would soon find out about the underworld of Neyrus. What could you possibly find down there? Monsters? Treasure? Salvation?</p>"; 
